import pandas as pd
import matplotlib.pyplot as plt
import seaborn as sns
import streamlit as st

# Setting seaborn style
sns.set(style='dark')

# Preparing day_df data
day_df = pd.read_csv('C:\\Users\\LENOVO\\Downloads\\bike-sharing-rentals-main\\dashboard\\day.csv')
day_df.head()

# Dropping unnecessary columns
drop_col = ['windspeed']

for i in day_df.columns:
  if i in drop_col:
    day_df.drop(labels=i, axis=1, inplace=True)

# Renaming column titles
day_df.rename(columns={
    'dteday': 'dateday',
    'yr': 'year',
    'mnth': 'month',
    'weathersit': 'weather_cond',
    'cnt': 'count'
}, inplace=True)

# Converting numbers to descriptions
day_df['month'] = day_df['month'].map({
    1: 'Jan', 2: 'Feb', 3: 'Mar', 4: 'Apr', 5: 'May', 6: 'Jun',
    7: 'Jul', 8: 'Aug', 9: 'Sep', 10: 'Oct', 11: 'Nov', 12: 'Dec'
})
day_df['season'] = day_df['season'].map({
    1: 'Spring', 2: 'Summer', 3: 'Fall', 4: 'Winter'
})

# Prepare daily_rent_df
def create_daily_rent_df(df):
    dailyrent_df = df.groupby(by='dateday').agg({
        'count': 'sum'
    }).reset_index()
    return dailyrent_df

# Prepare daily_casual_rent_df
def create_daily_casual_rent_df(df):
    daily_casual_rent_df = df.groupby(by='dateday').agg({
        'casual': 'sum'
    }).reset_index()
    return daily_casual_rent_df

# Prepare daily_registered_rent_df
def create_daily_registered_rent_df(df):
    daily_registered_rent_df = df.groupby(by='dateday').agg({
        'registered': 'sum'
    }).reset_index()
    return daily_registered_rent_df
    
# Prepare season_rent_df
def create_season_rent_df(df):
    season_rent_df = df.groupby(by='season')[['registered', 'casual']].sum().reset_index()
    return season_rent_df

# Prepare monthly_rent_df
def create_monthly_rent_df(df):
    monthly_rent_df = df.groupby(by='month').agg({
        'count': 'sum'
    })
    ordered_months = [
        'Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun',
        'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec'
    ]
    monthly_rent_df = monthly_rent_df.reindex(ordered_months, fill_value=0)
    return monthly_rent_df

# Prepare weekday_rent_df
def create_weekday_rent_df(df):
    weekday_rent_df = df.groupby(by='weekday').agg({
        'count': 'sum'
    }).reset_index()
    return weekday_rent_df

# Prepare workingday_rent_df
def create_workingday_rent_df(df):
    workingday_rent_df = df.groupby(by='workingday').agg({
        'count': 'sum'
    }).reset_index()
    return workingday_rent_df

# Prepare holiday_rent_df
def create_holiday_rent_df(df):
    holiday_rent_df = df.groupby(by='holiday').agg({
        'count': 'sum'
    }).reset_index()
    return holiday_rent_df

# Prepare weather_rent_df
def create_weather_rent_df(df):
    weather_rent_df = df.groupby(by='weather_cond').agg({
        'count': 'sum'
    })
    return weather_rent_df

# Creating filter components
min_date = pd.to_datetime(day_df['dateday']).dt.date.min()
max_date = pd.to_datetime(day_df['dateday']).dt.date.max()

 
with st.sidebar:
    st.image('data:image/jpeg;base64,')
    
    # Taking start_date & end_date dari date_input
    start_date, end_date = st.date_input(
        label='Set time range',
        min_value= min_date,
        max_value= max_date,
        value=[min_date, max_date]
    )

main_df = day_df[(day_df['dateday'] >= str(start_date)) & 
                (day_df['dateday'] <= str(end_date))]

# Prepare dataframe
daily_rent_df = create_daily_rent_df(main_df)
daily_casual_rent_df = create_daily_casual_rent_df(main_df)
daily_registered_rent_df = create_daily_registered_rent_df(main_df)
season_rent_df = create_season_rent_df(main_df)
monthly_rent_df = create_monthly_rent_df(main_df)

# Making Dashboard 

# Title
st.header('Bike-Sharing Analysis Dashboard')

# Show daily renters
st.subheader('Daily bicycle renters')
col1, col2, col3 = st.columns(3)

with col1:
    daily_rent_total = daily_rent_df['count'].sum()
    st.metric('Total Bikers', value= daily_rent_total)

with col2:
    daily_rent_registered = daily_registered_rent_df['registered'].sum()
    st.metric('Registered Bikers', value= daily_rent_registered)
 
with col3:
    daily_rent_casual = daily_casual_rent_df['casual'].sum()
    st.metric('Casual Bikers', value= daily_rent_casual)
   
# Show sum monthly renters
st.subheader('Monthly bicycle renters')
fig, ax = plt.subplots(figsize=(24, 8))
ax.plot(
    monthly_rent_df.index,
    monthly_rent_df['count'],
    marker='o', 
    linewidth=2,
    color='tab:blue'
)

for index, row in enumerate(monthly_rent_df['count']):
    ax.text(index, row + 1, str(row), ha='center', va='bottom', fontsize=12)

ax.tick_params(axis='x', labelsize=25, rotation=45)
ax.tick_params(axis='y', labelsize=20)
st.pyplot(fig)

# show seasonly renters
st.subheader('Seasonly bicycle renters')

fig, ax = plt.subplots(figsize=(16, 8))

sns.barplot(
    y='season',  # Change x='season' to y='season'
    x='registered',  # Change y='registered' to x='registered'
    data=season_rent_df,
    label='Registered',
    color='tab:purple',
    ax=ax
)

sns.barplot(
    y='season',  # Change x='season' to y='season'
    x='casual',  # Change y='casual' to x='casual'
    data=season_rent_df,
    label='Casual',
    color='tab:green',
    ax=ax
)

for index, row in season_rent_df.iterrows():
    ax.text(row['registered'], index, str(row['registered']), ha='left', va='center', fontsize=12)
    ax.text(row['casual'], index, str(row['casual']), ha='left', va='center', fontsize=12)

ax.set_xlabel(None)
ax.set_ylabel(None)
ax.tick_params(axis='y', labelsize=20)  # Change axis='x' to axis='y'
ax.tick_params(axis='x', labelsize=15)  # Change axis='y' to axis='x'
ax.legend()
plt.tight_layout()
st.pyplot(fig)

plt.tight_layout()

st.caption('(c) Nur Annisaa Meiarti Fajrin 2024')